import React from 'react';

import 
{
    BrowserRouter as Router,
    Switch,
    Route
}
from "react-router-dom";

import LoginPage from './components/Pages/LoginPage/LoginPage';
import HomePage from './components/Pages/HomePage/HomePage';
import Footer from './components/shared/footer/Footer';
import './App.css';
import RegisterPage from './components/Pages/RegisterPage/RegisterPage';
import NewPasswordForm from './components/Pages/NewPasswordPage/NewPasswordPage';
import ResetPasswordPage from './components/Pages/ResetPasswordPage/ResetPasswordPage';
import AuthRoute from './components/shared/AuthRoute/AuthRoute';


class App extends React.Component {

  _id:string|number = ""
  state = {
    isAuthUser: false,
    userId: this._id
  }

  render () {
    return (
      <React.StrictMode>
        <Router>  
          <div className="App">
            <Switch>
                <Route path="/">
                  <LoginPage />
                </Route>
                <Route path="/login">
                  <LoginPage />
                </Route>
                <Route path="/register">
                  <RegisterPage />
                </Route>
                <Route path="/home">
                  <HomePage />
                </Route>
                <Route path="/resetpassword">
                  <ResetPasswordPage />
                </Route>
                <Route path="/newpassword">
                  <NewPasswordForm />
                </Route>
              </Switch>
              <Footer />
            </div>
          </Router>
      </React.StrictMode>
    );
  }
}

export default App;
